import './App.css';
import EmployeeLinks from './Employee-links'
import JumboTron from './Jumbotron'
import 'bootstrap/dist/css/bootstrap.min.css'
import { Container, Row, Col } from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
            <EmployeeLinks/>
          </Col>
          <Col>
            {/* <JumboTron/> */}
          </Col>       
        </Row>
      </Container>
    </div>
  );
}

export default App;
